import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import Driver from "../agents/Driver";
import Passenger from "../agents/Passenger";

function Screen(props) {
  const numDrivers = 4;
  const [drivers, setDrivers] = useState([]);

  useEffect(() => {
    createDrivers(numDrivers);
  }, []);

  function createDrivers(numDrivers) {
    const newDrivers = [];
    for (let i = 0; i < numDrivers; i++) {
      const driver = new Driver(30);
      newDrivers.push(driver);
    }
    setDrivers(newDrivers);
  }

  const driverList = drivers.map((driver) => (
    <div key={driver.id}>
      <p>Driver state: {driver.state}</p>
      <p>Driver location: {JSON.stringify(driver.location)}</p>
    </div>
  ));

  return (
    <div>
      <h1>Simulation</h1>
      <div>{driverList}</div>
      {/* <div> {passengers}</div> */}
    </div>
  );
}

export default Screen;

